import React, { useState, useRef } from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
  IconButton,
  InputBase,
  Menu,
  MenuItem
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import { Link, useNavigate } from 'react-router-dom';

export default function Navbar() {
  const navigate = useNavigate();

  // MenÃº de productos con hover y cierre retardado
  const [anchorElProd, setAnchorElProd] = useState(null);
  const timeoutRef = useRef();

  const handleHoverProductos = (event) => {
    clearTimeout(timeoutRef.current);
    setAnchorElProd(event.currentTarget);
  };

  const handleLeaveProductos = () => {
    timeoutRef.current = setTimeout(() => setAnchorElProd(null), 250);
  };

  // Selector de paÃ­s
  const [anchorElPais, setAnchorElPais] = useState(null);
  const [paisSeleccionado, setPaisSeleccionado] = useState("Ecuador");

  const handleOpenPais = (event) => setAnchorElPais(event.currentTarget);
  const handleClosePais = () => setAnchorElPais(null);
  const cambiarPais = (pais) => {
    setPaisSeleccionado(pais);
    handleClosePais();
  };

  return (
    <AppBar position="static" sx={{ bgcolor: '#2e7d32' }}>
      <Toolbar sx={{ display: 'flex', justifyContent: 'space-between' }}>
        {/* Logo y tÃ­tulo */}
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
          <IconButton edge="start" color="inherit" aria-label="menÃº">
            <MenuIcon />
          </IconButton>
          <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
            <Typography variant="h6" sx={{ fontWeight: 'bold' }}>
              ðŸŒ¾ Mercado AgrÃ­cola
            </Typography>
          </Link>
        </Box>

        {/* Botones institucionales */}
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 3 }}>
          <Button color="inherit" onClick={() => navigate('/nosotros')}>Nosotros</Button>

          {/* MenÃº de productos con hover */}
          <Box onMouseEnter={handleHoverProductos} onMouseLeave={handleLeaveProductos}>
            <Button color="inherit" endIcon={<ExpandMoreIcon />} sx={{ textTransform: 'none' }}>
              Productos
            </Button>
            <Menu
              anchorEl={anchorElProd}
              open={Boolean(anchorElProd)}
              onClose={() => setAnchorElProd(null)}
              MenuListProps={{
                onMouseEnter: handleHoverProductos,
                onMouseLeave: handleLeaveProductos
              }}
              PaperProps={{
                sx: {
                  backgroundColor: '#e8f5e9',
                  borderRadius: 2,
                  boxShadow: '0 4px 12px rgba(0,0,0,0.3)',
                  color: '#2e7d32'
                }
              }}
            >
              <MenuItem onClick={() => navigate('/productos/agricola')}>AgrÃ­cola</MenuItem>
              <MenuItem onClick={() => navigate('/productos/banano')}>Banano</MenuItem>
              <MenuItem onClick={() => navigate('/productos/acuacultura')}>Acuacultura</MenuItem>
              <MenuItem onClick={() => navigate('/productos/fertilizantes')}>Fertilizantes</MenuItem>
              <MenuItem onClick={() => navigate('/productos/larvicultura')}>Larvicultura</MenuItem>
              <MenuItem onClick={() => navigate('/productos/mascotas')}>Mascotas</MenuItem>
              <MenuItem onClick={() => navigate('/productos/quimicos')}>QuÃ­micos</MenuItem>
              <MenuItem onClick={() => navigate('/productos/salud-animal')}>Salud Animal</MenuItem>
              <MenuItem onClick={() => navigate('/productos/salud-publica')}>Salud PÃºblica</MenuItem>
              <MenuItem onClick={() => navigate('/productos/semillas')}>Semillas</MenuItem>
            </Menu>
          </Box>

          <Button color="inherit" onClick={() => navigate('/servicios')}>Servicios en lÃ­nea</Button>

          {/* Selector de paÃ­s */}
          <Button color="inherit" onClick={handleOpenPais} endIcon={<ExpandMoreIcon />}>
            PaÃ­s: {paisSeleccionado}
          </Button>
          <Menu anchorEl={anchorElPais} open={Boolean(anchorElPais)} onClose={handleClosePais}>
            <MenuItem onClick={() => cambiarPais('Ecuador')}>ðŸ‡ªðŸ‡¨ Ecuador</MenuItem>
            <MenuItem onClick={() => cambiarPais('PerÃº')}>ðŸ‡µðŸ‡ª PerÃº</MenuItem>
            <MenuItem onClick={() => cambiarPais('Colombia')}>ðŸ‡¨ðŸ‡´ Colombia</MenuItem>
            <MenuItem onClick={() => cambiarPais('MÃ©xico')}>ðŸ‡²ðŸ‡½ MÃ©xico</MenuItem>
          </Menu>

          {/* Barra de bÃºsqueda */}
          <Box sx={{
            display: 'flex',
            alignItems: 'center',
            backgroundColor: '#ffffff33',
            padding: '4px 12px',
            borderRadius: '20px',
            transition: 'all 0.3s ease-in-out',
            '&:hover': { backgroundColor: '#ffffff55' }
          }}>
            <InputBase
              placeholder="Buscarâ€¦"
              sx={{ color: 'inherit', ml: 1 }}
            />
            <IconButton size="small" sx={{ color: 'inherit' }}>
              <SearchIcon />
            </IconButton>
          </Box>
        </Box>
      </Toolbar>
    </AppBar>
  );
}
